import React from 'react'
import Signup from './Signup'

export default class Home extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return(
            <div>
                <h1>Home</h1>
                <p>Status: {this.props.loggedInStatus}</p>
                <Signup />
            </div>
        )
    }
}
